import React from 'react';
import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"

function App() {
  return (
    <div className="app">
      <Router>
        <>
          <Routes>
            <Route path="/">
              <h1>This is the homepage </h1>
            </Route>
          </Routes>
        </>
      </Router>
    </div>
  );
}

export default App;
